const fs = require('fs');
const config = require('../../../config/appconfig').default;
const getGalaxyId = require('../galaxy/index');
const getStarInfo = require('../star/index');
const Planet = require('../../../utils/models/planet').default;
const uploadFileToS3 = require('../../../misc/AWS');
const getPlanetNameBySeed = require('./planetNames');
const AWN_S3_Settings = require('../../../utils/settings/AWS_S3_Settings.json');

const getSumOfArray = (arr) => arr.reduce((a, b) => a + b);
const getRandomValueByMinAndMax = (min, max) => Math.floor( Math.random(min, max) * (max - min) )
const sumOfInterval = (from, to, sumFrom = 1) => from === to ? sumFrom : sumOfInterval(++from, to, from + sumFrom);
const up = (value) => Math.round(value * 100);
// TODO: use randomUtils
const randomInRangeBySeed = (seed, rangeA, rangeB) => rangeA + Math.round(random(seed, 1000) * (rangeB - rangeA));
const generatePlanetType = (seed, lengthOfTypesPlanets) =>  randomInRangeBySeed(1 + seed, 0, lengthOfTypesPlanets);
const getPlanetRadius = () => 1;

function random(seed, multiplier) {
	if (typeof multiplier === 'undefined')
		multiplier = 1;
	var x = Math.sin(seed) * multiplier;
	return x - Math.floor(x);
}

async function getGeneratedPlanets(generatorConfig, countMissedRealises) {
  const generatedPlanets = []

  const { generator } = JSON.parse(fs.readFileSync(`${__dirname}/../config.json`, 'utf8'));

  const { types }  = generatorConfig;

  async function getPlanet(seed) {

    const specialSeed = seed;

    const name = getPlanetNameBySeed(seed);

    const star = getStarInfo();
    const { coords } = star;
    const { system } = star;

    const galaxyId = getGalaxyId();
    const radius = getPlanetRadius();

    const id = genPlanetId(galaxyId, radius, coords);

    const celestialType = generatePlanetType(seed, types.length);

    const population = getPopulationForGenerator(generator.population);
    const type = getTypeForGenerator(types);

    const idOfType = generator.types.findIndex((type) => type.name === type);
    const rarityMultiplier = generator.types[idOfType].rarityMultiplier;

    // const price = getPriceByPopulation(population, rarityMultiplier);

		/* upload picture planet to AWS S3 */
		const BucketName = `${config.bucketName}/${AWN_S3_Settings.nameFolderOfPlanets}`;
		uploadFileToS3(getFileOfPictureById(id), BucketName);

    return {
      id,
      owner: 'none',
      description: {
        name,
        galaxy,
        system,
        celestialType,
        coords,
        radius,
        seed,
        specialSeed
      },
      status: {
        forSale: true,
        lockGUID: 'none',
        sale: {
          desc: '',
          // price
        }
      },
      lastOwnerUpdate: 0, //not changing in generation
      timestamp: null,
      population,
      type,
    }
  }


  const countPlanets = generatorConfig.count_planets_per_generation * countMissedRealises;

  const seed = await Planet.countDocuments();
  for (let i = 0; i < countPlanets; i++) {
    generatedPlanets.push(await getPlanet(seed + i));
  }

  return generatedPlanets;

}


function getTypeForGenerator(types) {
  // frequencies float to int
  let frequencies = types.map(type => up(type.frequency));
  frequencies = frequencies.sort((a, b) => b - a);

  // sum of frequencies
  const sum = getSumOfArray(frequencies);

  // random value from 0 to sum of frequencies
  const randomValue = getRandomValueByMinAndMax(0, sum);

  // search type from randomValue
  let searchSum = 0;
  for (let i = 0; i < types.length; i++) {

    searchSum += up(types[i].frequency);

    // return type
    if (searchSum >= randomValue) return types[i].name;
  }
}

function getPopulationForGenerator({ min, max }) {

  const allPop = sumOfInterval(min, max);

  const rand = getRandomValueByMinAndMax(min, allPop);

  let p = min;
  for (let i = min; i <= max; i++) {

    if (p > rand) return i;

    p += max - i;
  }
}

function getPriceByPopulation(population, rarityMultiplier) {
  const minimalPrice = process.env.MINIMAL_PRICE_OF_PLANET;
  const XemPerPopulation = process.env.XEM_PER_POPULATION;

  if (minimalPrice === undefined) throw new Error('environment variable MINIMAL_PRICE_OF_PLANET not set')

  if (XemPerPopulation === undefined) throw new Error('environment variable XEM_PER_POPULATION not set')

  const priceByPopulation = XemPerPopulation * population;

  return (minimalPrice + priceByPopulation) * rarityMultiplier;
}

function genPlanetId(galaxy, radius, {x, y, z, r}) {
  const res = [galaxy, radius, x, y, z, r].map((item, idx) => {
		let str;
		let expectedLength;
		let startPosition;

		switch (idx) {
			case 0:
				str = item.toString(36);
				expectedLength = 2;
				break;
			case 1:
				str = item.toString(36);
				expectedLength = 3;
				break;
			default:
				str = item >= 0 ? '_' + item.toString(36) : item.toString(36); // "_" means "+"
				expectedLength = 7;
				startPosition = 1;
		}
		return addZeros(str, expectedLength, startPosition);
	});
	return res.join('');

	function addZeros(str, expectedLength, startPosition = 0) {
		if (expectedLength - str.length > 0) {
			return [
				str.slice(0, startPosition),
				new Array(expectedLength - str.length + 1).join('0'),
				str.slice(startPosition)
			].join('');
		}
		return str;
	}
}

